import { getCalendar } from '../apiHandlers/calendarapi';

function CreateCalendar() {
  const [calendar, setCalendar] = useState('');
  useEffect(() => {
    async function fetchCalendar() {
      const data = getCalendar();
      return data
    }
    fetchCalendar();
  }, []);

  return (
    <div>
      <h2> { calendar } </h2>
    </div>
  );
}

export default CreateCalendar;
